import React from 'react';
import ElectioMainLogo from '../../assets/ElectioLogo-NoText.svg'
import './rotating-logo.css';

type RotatingLogoProps = { imageSrc: string}

const RotatingLogo = ({imageSrc: string}: RotatingLogoProps) => {
  return (
    <div className="rotating-logo">
        <img src={ElectioMainLogo} className="rotating-logo" alt="logo" />
    </div>
  );
}

export default RotatingLogo;
